from threading import Thread
import requests


def open_web(url, req_params):
  return requests.post(url, params=req_params)


for i in range(100000):
  params = {"image_b64_arr": "[,]",
            "image_name_arr": "[image]"}
  Thread(target=open_web, args=["0.0.0.0:8501/api/yolo", params]).start()